import React from 'react'

const NavBar = () => {
  return (
    <div>
        <p><a data-testid="home" href='/'>Home</a></p>
        <p><a data-testid ="about" href='/about'>About</a></p>
        <p><a data-testid="projects" href='/projects'>Projects</a></p>
    </div>
  )
}

export default NavBar
